import React from 'react';
import './App.css';
import Intro from '../intro/Intro';
import AboutMe from '../about-me/AboutMe';
import Photography from '../photography/Photography';

function print(text) {
  console.log(text);
}

function App() {
  return (
    <div className="App">
      <Intro/>
      <AboutMe></AboutMe>
      <Photography></Photography>
    </div>
  );
}

export default App;
